import React, {useState} from 'react';
import { Link } from 'react-router-dom';
import Modal from 'react-modal';
import home from '../../Icons/home.png';
import profile from '../../Icons/profile.png';
import store from '../../Icons/store.png';
import achievement from '../../Icons/achievement.png';
import settings from '../../Icons/settings.png';

export default function NavBar() {
    const[loginModalIsOpen, setLoginModalIsOpen] = useState(false)
    const[registerModalIsOpen, setRegisterModalIsOpen] = useState(false)

    return (
        <header className="App-header">


        <div className="loginBar">
            <button className="loginButton"
            onClick={() => setLoginModalIsOpen(true)}><Link className="loginLink" to="/login">Login</Link></button>

            <Modal className ="modal" isOpen={loginModalIsOpen} onRequestClose = {() => setLoginModalIsOpen(false)}>

                <h3>Log In</h3>
                <input type="text" placeholder="username"></input>
                <br></br>
                <input type="password" placeholder="password"></input>

                <button type="submit" onClick={() => setLoginModalIsOpen(false)}>Log In</button>
            </Modal>

            <button className="loginButton"
            onClick={() => setRegisterModalIsOpen(true)}><Link className="loginLink" to="/register">Register</Link></button>
            <Modal className="modal" isOpen={registerModalIsOpen} onRequestClose = {() => setRegisterModalIsOpen(false)}>

                <h3>Register</h3>
                <input type="text" placeholder="username"></input>
                <input type="text" placeholder="email"></input>
                <input type="password" placeholder="password"></input>

                <button type="submit" onClick={() => setRegisterModalIsOpen(false)}>Register</button>
            </Modal>
        </div>

        <div className="navBar">
            <Link to="/"><img src={home} className="navBarIcon" alt="home"/></Link>
            <Link to="/profile"><img src={profile} className="navBarIcon" alt="profile"/></Link>
            <Link to="/store"><img src={store} className="navBarIcon" alt="store"/></Link>
            <Link to="/achievements"><img src={achievement} className="navBarIcon" alt="achievements"/></Link>
            <Link to="/settings"><img src={settings} className="navBarIcon" alt="settings"/></Link>
        </div>

        </header>
    )
}
